    playbackData.comments = {"ev-0":[{"id":"commentId-0","displayCommentEvent":{"id":"ev-0","timestamp":1661637745488,"createdByDevGroupId":"devGroupId-1","eventSequenceNumber":0,"permanentRelevance":"never relevant","type":"CREATE DIRECTORY","directoryId":"dirId-0","directoryPath":"/","parentDirectoryId":null},"developerGroupId":"devGroupId-1","timestamp":1661637745491,"commentText":"<div>This program describes <span style=\"font-family: Courier;\"><a href=\"https://hexdocs.pm/elixir/Map.html\">Maps</a></span> in Elixir. Maps are key/value pairs. These offer fast lookup of a value based on a key instead of a zero based&nbsp;index like with a tuple.</div><div><br></div><div>Elixir uses&nbsp;pattern matching and 'efficient immutability' when dealing with maps.<br></div>","commentTitle":"","selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"","viewableBlogText":"","commentTags":[],"questionCommentData":null}],"ev-84":[{"id":"commentId-1","displayCommentEvent":{"id":"ev-84","timestamp":1661637797958,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":84,"type":"INSERT","fileId":"fileId-0","character":"NEWLINE","previousNeighborId":"ev-83","lineNumber":2,"column":26,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1661637855726,"commentText":"<div>On line 2 I use <span style=\"font-family: Courier;\"><a href=\"https://hexdocs.pm/elixir/IO.html#inspect/2\">IO.inspect</a></span> to display the map. See the attached screenshot.&nbsp;</div><div><br></div><div>In the output, the keys are not necessarily ordered in the same way that they are defined in the code, alphabetically, or in any other logical way. Internally, Elixir has its own way of defining the structure of a map.<br></div>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"friendly_name","startRow":0,"startColumn":0,"endRow":0,"endColumn":13},{"fileId":"fileId-0","selectedText":"friendly_name","startRow":1,"startColumn":11,"endRow":1,"endColumn":24}],"imageURLs":["media/images/1661637852528-01.png"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/08.exs","viewableBlogText":"friendly_name = %{:first => \"Mark\", :last => \"Mahoney\"}\nIO.inspect(friendly_name)","commentTags":["image","successful-run"],"questionCommentData":null}],"ev-162":[{"id":"commentId-2","displayCommentEvent":{"id":"ev-162","timestamp":1661637911142,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":162,"type":"INSERT","fileId":"fileId-0","character":"y","previousNeighborId":"ev-161","lineNumber":4,"column":16,"pastedEventId":"ev-9"},"developerGroupId":"devGroupId-2","timestamp":1661637940267,"commentText":"<div>One way to access the values in a map is to place a key in square brackets after the name of the map.&nbsp;</div><div><br></div><div>Here I am using the atoms <span style=\"font-family: Courier;\">:first</span> and <span style=\"font-family: Courier;\">:last</span> inside square brackets to retrieve and then print out the two values (see the attached screenshot).</div>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"friendly_name[:first]","startRow":2,"startColumn":8,"endRow":2,"endColumn":29},{"fileId":"fileId-0","selectedText":"friendly_name[:last]","startRow":3,"startColumn":8,"endRow":3,"endColumn":28}],"imageURLs":["media/images/1661637938300-02.png"],"videoURLs":[],"audioURLs":[],"linesAbove":2,"linesBelow":0,"currentFilePath":"/08.exs","viewableBlogText":"friendly_name = %{:first => \"Mark\", :last => \"Mahoney\"}\nIO.inspect(friendly_name)\nIO.puts(friendly_name[:first])\nIO.puts(friendly_name[:last])","commentTags":["image","successful-run"],"questionCommentData":null}],"ev-226":[{"id":"commentId-3","displayCommentEvent":{"id":"ev-226","timestamp":1661637966264,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":226,"type":"INSERT","fileId":"fileId-0","character":"NEWLINE","previousNeighborId":"ev-225","lineNumber":7,"column":25,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1661637995769,"commentText":"Here is a new map that holds only a middle name. On line 7 I print it (see the attached screenshot).<br>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"partial_name = %{:middle => \"Robert\"}\n","startRow":5,"startColumn":0,"endRow":6,"endColumn":0},{"fileId":"fileId-0","selectedText":"partial_name","startRow":6,"startColumn":11,"endRow":6,"endColumn":23}],"imageURLs":["media/images/1661797312470-14.jpeg","media/images/1661637992889-03.png"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/08.exs","viewableBlogText":"partial_name = %{:middle => \"Robert\"}\nIO.inspect(partial_name)","commentTags":["image","successful-run"],"questionCommentData":null}],"ev-359":[{"id":"commentId-4","displayCommentEvent":{"id":"ev-359","timestamp":1661638037355,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":359,"type":"INSERT","fileId":"fileId-0","character":"NEWLINE","previousNeighborId":"ev-358","lineNumber":12,"column":26,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1661638071993,"commentText":"<div>The <span style=\"font-family: Courier;\"><a href=\"https://hexdocs.pm/elixir/Map.html\">Map</a></span> module has a function named <span style=\"font-family: Courier;\"><a href=\"https://hexdocs.pm/elixir/Map.html#merge/2\">merge/2</a></span> that will efficiently create a new map from two existing ones.&nbsp;</div><div><br></div><div>On line 9 I combine the two maps and create a binding to the name, <span style=\"font-family: Courier;\">full_name</span>.&nbsp;</div><div><br></div><div>Elixir can't change either <span style=\"font-family: Courier;\">friendly_name</span> or <span style=\"font-family: Courier;\">partial_name</span> because all data is immutable. Some other code may still be using those names and that code expects the data to be unchanged. It can efficiently create references to these, however (see the attached picture).<br></div><div><br></div><div>If the two maps share the same keys then the second map's keys/values will have precedence in the new map.<br></div>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"Map.merge(friendly_name, partial_name)","startRow":8,"startColumn":12,"endRow":8,"endColumn":50}],"imageURLs":["media/images/1661797975012-15.jpeg"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/08.exs","viewableBlogText":"full_name = Map.merge(friendly_name, partial_name)","commentTags":["image"],"questionCommentData":null},{"id":"commentId-16","displayCommentEvent":{"id":"ev-359","timestamp":1661638037355,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":359,"type":"INSERT","fileId":"fileId-0","character":"NEWLINE","previousNeighborId":"ev-358","lineNumber":12,"column":26,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1661798225859,"commentText":"On lines 10-13 I use the new map to retrieve all of the parts of my name.<br>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"full_name","startRow":8,"startColumn":0,"endRow":8,"endColumn":9},{"fileId":"fileId-0","selectedText":"full_name[:first]","startRow":9,"startColumn":8,"endRow":9,"endColumn":25},{"fileId":"fileId-0","selectedText":"full_name[:middle]","startRow":10,"startColumn":8,"endRow":10,"endColumn":26},{"fileId":"fileId-0","selectedText":"full_name[:last]","startRow":11,"startColumn":8,"endRow":11,"endColumn":24}],"imageURLs":["media/images/1661798223149-04.png"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/08.exs","viewableBlogText":"full_name = Map.merge(friendly_name, partial_name)\nIO.puts(full_name[:first])\nIO.puts(full_name[:middle])\nIO.puts(full_name[:last])","commentTags":["image","successful-run"],"questionCommentData":null}],"ev-371":[{"id":"commentId-5","displayCommentEvent":{"id":"ev-371","timestamp":1661638109467,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":371,"type":"INSERT","fileId":"fileId-0","character":".","previousNeighborId":"ev-350","lineNumber":12,"column":18,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1661638136409,"commentText":"<div>One nice feature of maps is that if you use atoms as keys then you can use dot notation instead of using the square brackets. The program output is exactly the same.<br></div>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":":first","startRow":0,"startColumn":18,"endRow":0,"endColumn":24},{"fileId":"fileId-0","selectedText":":last","startRow":0,"startColumn":36,"endRow":0,"endColumn":41},{"fileId":"fileId-0","selectedText":":middle","startRow":5,"startColumn":17,"endRow":5,"endColumn":24},{"fileId":"fileId-0","selectedText":"full_name.first","startRow":9,"startColumn":8,"endRow":9,"endColumn":23},{"fileId":"fileId-0","selectedText":"full_name.middle","startRow":10,"startColumn":8,"endRow":10,"endColumn":24},{"fileId":"fileId-0","selectedText":"full_name.last","startRow":11,"startColumn":8,"endRow":11,"endColumn":22}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/08.exs","viewableBlogText":"friendly_name = %{:first => \"Mark\", :last => \"Mahoney\"}\nIO.inspect(friendly_name)\nIO.puts(friendly_name[:first])\nIO.puts(friendly_name[:last])\n\npartial_name = %{:middle => \"Robert\"}\nIO.inspect(partial_name)\n\nfull_name = Map.merge(friendly_name, partial_name)\nIO.puts(full_name.first)\nIO.puts(full_name.middle)\nIO.puts(full_name.last)","commentTags":["successful-run"],"questionCommentData":null}],"ev-575":[{"id":"commentId-6","displayCommentEvent":{"id":"ev-575","timestamp":1661638204271,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":575,"type":"INSERT","fileId":"fileId-0","character":"NEWLINE","previousNeighborId":"ev-574","lineNumber":15,"column":136,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1661638242440,"commentText":"<div>Here I am using the <span style=\"font-family: Courier;\">Map</span> module's <span style=\"font-family: Courier;\"><a href=\"https://hexdocs.pm/elixir/Map.html#put_new/3\">put_new/3</a></span> function to 'add' a new key value pair to a map.&nbsp;</div><div><br></div><div>Of course, nothing about the original map, <span style=\"font-family: Courier;\">full_name</span>, will change because of Elixir's immutability. However, a new map is created and added to the chain of maps (see the first attached picture).</div><div><br></div><div>As a programmer, you don't have to think too much about this combination of maps. It is ok to abstract that complexity away and think about the maps as in the second attached picture.<br></div>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"Map.put_new(full_name, :highest_degree, \"PhD\")","startRow":13,"startColumn":20,"endRow":13,"endColumn":66}],"imageURLs":["media/images/1661799288966-16.jpeg","media/images/1661799288966-17.jpeg","media/images/1661638239968-05.png"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":1,"currentFilePath":"/08.exs","viewableBlogText":"professional_name = Map.put_new(full_name, :highest_degree, \"PhD\")\nIO.puts(\"#{professional_name[:first]} #{professional_name[:middle]} #{professional_name[:last]} #{professional_name[:highest_degree]}\")","commentTags":["image","successful-run"],"questionCommentData":null}],"ev-724":[{"id":"commentId-7","displayCommentEvent":{"id":"ev-724","timestamp":1661638274415,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":724,"type":"INSERT","fileId":"fileId-0","character":"NEWLINE","previousNeighborId":"ev-723","lineNumber":18,"column":120,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1661638314918,"commentText":"<div>If you would like to specify a default value to use instead of <span style=\"font-family: Courier;\">nil</span> when a key is not found then use the <span style=\"font-family: Courier;\">Map</span> module's <span style=\"font-family: Courier;\"><a href=\"https://hexdocs.pm/elixir/Map.html#get/3\">get/3</a></span> function.</div><div><br></div><div>It takes the name of a map, a key value, and a default value to return if the key does not exist. If the key exists in the map its associated value will be returned. If not, the default value will be returned.</div><div><br></div><div>The print on line 18 shows an example. See the attached screenshot.<br></div>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"Map.get(full_name, :suffix, \"The First\")","startRow":17,"startColumn":75,"endRow":17,"endColumn":115}],"imageURLs":["media/images/1661638311561-06.png"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/08.exs","viewableBlogText":"IO.puts(\"#{full_name[:first]} #{full_name[:middle]} #{full_name[:last]} (#{Map.get(full_name, :suffix, \"The First\")})\")","commentTags":["image","successful-run"],"questionCommentData":null}],"ev-786":[{"id":"commentId-18","displayCommentEvent":{"id":"ev-786","timestamp":1661638367338,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":786,"type":"INSERT","fileId":"fileId-0","character":"NEWLINE","previousNeighborId":"ev-785","lineNumber":21,"column":19,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1661800106470,"commentText":"<div>Pattern matching works with maps too.&nbsp;</div><div><br></div><div>On \nline 20 I create what looks like a map on the left hand side of the \nmatch operator. In it, I specify an atom key and a name to be bound to a \nvalue.</div>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"%{:last => last_name}","startRow":19,"startColumn":0,"endRow":19,"endColumn":21}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/08.exs","viewableBlogText":"%{:last => last_name} = professional_name","commentTags":[],"questionCommentData":null},{"id":"commentId-8","displayCommentEvent":{"id":"ev-786","timestamp":1661638367338,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":786,"type":"INSERT","fileId":"fileId-0","character":"NEWLINE","previousNeighborId":"ev-785","lineNumber":21,"column":19,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1661638413131,"commentText":"<div>The value on the right hand side of the match is a complete map.&nbsp;</div><div><br></div><div>Elixir will do its best to make the expression evaluate to true. The way it does this is to look for a corresponding key, <span style=\"font-family: Courier;\">:last</span>, in <span style=\"font-family: Courier;\">professional_name</span> and bind its value to the name <span style=\"font-family: Courier;\">last_name</span>. See the first attached picture.</div><div><br></div><div>On line 21 I print out <span style=\"font-family: Courier;\">last_name</span>. See the attached screenshot.<br></div>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"professional_name","startRow":19,"startColumn":24,"endRow":19,"endColumn":41},{"fileId":"fileId-0","selectedText":"last_name","startRow":20,"startColumn":8,"endRow":20,"endColumn":17}],"imageURLs":["media/images/1661800344036-18.jpeg","media/images/1661638409431-07.png"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/08.exs","viewableBlogText":"%{:last => last_name} = professional_name\nIO.puts(last_name)","commentTags":["image","successful-run"],"questionCommentData":null}],"ev-828":[{"id":"commentId-9","displayCommentEvent":{"id":"ev-828","timestamp":1661638445535,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":828,"type":"INSERT","fileId":"fileId-0","character":")","previousNeighborId":"ev-827","lineNumber":21,"column":19,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1661638481865,"commentText":"<div>On line 20 I am matching two keys from <span style=\"font-family: Courier;\">professional_name</span> and binding their values to <span style=\"font-family: Courier;\">first_name</span> and <span style=\"font-family: Courier;\">last_name</span>.&nbsp;</div><div><br></div><div>The attached screenshot shows the output with my first and last name.</div>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":":first => first_name, :last => last_name","startRow":19,"startColumn":2,"endRow":19,"endColumn":42},{"fileId":"fileId-0","selectedText":"first_name","startRow":20,"startColumn":8,"endRow":20,"endColumn":18},{"fileId":"fileId-0","selectedText":"last_name","startRow":21,"startColumn":8,"endRow":21,"endColumn":17}],"imageURLs":["media/images/1661638477200-08.png"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/08.exs","viewableBlogText":"%{:first => first_name, :last => last_name} = professional_name\nIO.puts(first_name)\nIO.puts(last_name)","commentTags":["image"],"questionCommentData":null}],"ev-932":[{"id":"commentId-10","displayCommentEvent":{"id":"ev-932","timestamp":1661638561181,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":932,"type":"INSERT","fileId":"fileId-0","character":"\"","previousNeighborId":"ev-931","lineNumber":6,"column":36,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1661638582162,"commentText":"<div>When you are using atoms as keys there is a shorthand notation for writing key/value pairs in a map. The highlighted code on line 1 replaces this syntax:</div><div><br></div><div><span style=\"font-family: Courier;\">:first =&gt; \"Mark\", :last =&gt; \"Mahoney\"</span></div><div><br></div><div>This is only available to maps that use atoms for keys.<br></div>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"first: \"Mark\", last: \"Mahoney\"","startRow":0,"startColumn":18,"endRow":0,"endColumn":48}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/08.exs","viewableBlogText":"friendly_name = %{first: \"Mark\", last: \"Mahoney\"}","commentTags":[],"questionCommentData":null}],"ev-1128":[{"id":"commentId-11","displayCommentEvent":{"id":"ev-1128","timestamp":1661638686323,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":1128,"type":"INSERT","fileId":"fileId-0","character":"NEWLINE","previousNeighborId":"ev-1127","lineNumber":37,"column":30,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1661638728203,"commentText":"<div>Here I create another map. This time the keys are integers and the values are strings to help display ordinal values.&nbsp;</div><div><br></div><div>For example, the number 21 has the ordinal value \"21st\". This map can help me build these ordinal strings. I'll use these maps in the next program too.<br></div><div><br></div><div>On line 37 I print the whole map using <span style=\"font-family: Courier;\">IO.inspect</span>.<br></div>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"first_10_ordinals = %{\n  0 => \"0th\",\n  1 => \"1st\",\n  2 => \"2nd\",\n  3 => \"3rd\",\n  4 => \"4th\",\n  5 => \"5th\",\n  6 => \"6th\",\n  7 => \"7th\",\n  8 => \"8th\",\n  9 => \"9th\"\n}","startRow":23,"startColumn":0,"endRow":34,"endColumn":1},{"fileId":"fileId-0","selectedText":"first_10_ordinals","startRow":36,"startColumn":11,"endRow":36,"endColumn":28}],"imageURLs":["media/images/1661638726059-Screen%20Shot%202022-08-27%20at%205.18.28%20PM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/08.exs","viewableBlogText":"first_10_ordinals = %{\n  0 => \"0th\",\n  1 => \"1st\",\n  2 => \"2nd\",\n  3 => \"3rd\",\n  4 => \"4th\",\n  5 => \"5th\",\n  6 => \"6th\",\n  7 => \"7th\",\n  8 => \"8th\",\n  9 => \"9th\"\n}\n\nIO.inspect(first_10_ordinals)","commentTags":["image"],"questionCommentData":null}],"ev-1188":[{"id":"commentId-12","displayCommentEvent":{"id":"ev-1188","timestamp":1661638744317,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":1188,"type":"INSERT","fileId":"fileId-0","character":"NEWLINE","previousNeighborId":"ev-1187","lineNumber":39,"column":30,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1661638770763,"commentText":"<div>On lines 38-39 I use square bracket notation to retrieve and print two values from the map.&nbsp;</div><div><br></div><div>I can also use the <span style=\"font-family: Courier;\"><a href=\"https://hexdocs.pm/elixir/Map.html#get/3\">get</a></span> function but I cannot use dot notation because the keys are not atoms.</div>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"IO.puts(first_10_ordinals[0])\nIO.puts(first_10_ordinals[9])","startRow":37,"startColumn":0,"endRow":38,"endColumn":29}],"imageURLs":["media/images/1661638768345-10.png"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/08.exs","viewableBlogText":"IO.puts(first_10_ordinals[0])\nIO.puts(first_10_ordinals[9])","commentTags":["image"],"questionCommentData":null}],"ev-1371":[{"id":"commentId-13","displayCommentEvent":{"id":"ev-1371","timestamp":1661638800040,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":1371,"type":"INSERT","fileId":"fileId-0","character":"NEWLINE","previousNeighborId":"ev-1370","lineNumber":45,"column":30,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1661638827937,"commentText":"The ordinal strings work consistently with all of the numbers except for 11, 12, and 13. Here I create a special map to deal with these.<br>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"special_ordinals = %{11 => \"11th\", 12 => \"12th\", 13 => \"13th\"}\n","startRow":40,"startColumn":0,"endRow":41,"endColumn":0}],"imageURLs":["media/images/1661638825730-Screen%20Shot%202022-08-27%20at%205.20.10%20PM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":3,"currentFilePath":"/08.exs","viewableBlogText":"special_ordinals = %{11 => \"11th\", 12 => \"12th\", 13 => \"13th\"}\nIO.inspect(special_ordinals)\nIO.puts(special_ordinals[11])\nIO.puts(special_ordinals[12])\nIO.puts(special_ordinals[13])","commentTags":["image"],"questionCommentData":null}],"ev-1510":[{"id":"commentId-14","displayCommentEvent":{"id":"ev-1510","timestamp":1661638849002,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":1510,"type":"INSERT","fileId":"fileId-0","character":"NEWLINE","previousNeighborId":"ev-1509","lineNumber":50,"column":26,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1661638921103,"commentText":"<div>Finally, I merge the two maps to create a new one. Then I retrieve and print a couple values from the new map.</div><div><br></div><div>Remember that the new map, <span style=\"font-family: Courier;\">all_ordinals</span>, is efficiently built from the other two maps, <span style=\"font-family: Courier;\">first_10_ordinals</span> and <span style=\"font-family: Courier;\">special_ordinals</span>.</div><div><br></div><div>Challenge: draw what you think the <span style=\"font-family: Courier;\">all_ordinals</span> map looks like with Elixir's 'efficient immutability'.<br></div>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"Map.merge(first_10_ordinals, special_ordinals)","startRow":46,"startColumn":15,"endRow":46,"endColumn":61}],"imageURLs":["media/images/1661638918313-12v2.png"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":3,"currentFilePath":"/08.exs","viewableBlogText":"all_ordinals = Map.merge(first_10_ordinals, special_ordinals)\nIO.inspect(all_ordinals)\nIO.puts(all_ordinals[0])\nIO.puts(all_ordinals[13])","commentTags":["challenge","image"],"questionCommentData":null}],"ev-56":[{"id":"commentId-15","displayCommentEvent":{"id":"ev-56","timestamp":1661637787589,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":56,"type":"INSERT","fileId":"fileId-0","character":"}","previousNeighborId":"ev-55","lineNumber":1,"column":55,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1661796954205,"commentText":"<div>A map can be created in code using this notation:</div><div><br></div><div><span style=\"font-family: Courier;\">%{key1 =&gt; value, key2 =&gt; value}</span></div><div><br></div><div>Here I create a map to hold my name. The two keys are atoms which describe the associated parts of a name.&nbsp;</div><div><br></div><div>Keys and values can be any type but the keys are usually values like atoms, strings, or integers. Duplicate keys are not allowed.<br></div><div><br></div><div>Then I the map to the name, <span style=\"font-family: Courier;\">friendly_name</span>.<br></div>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"%{:first => \"Mark\", :last => \"Mahoney\"}","startRow":0,"startColumn":16,"endRow":0,"endColumn":55}],"imageURLs":["media/images/1661796673555-13.jpeg"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/08.exs","viewableBlogText":"friendly_name = %{:first => \"Mark\", :last => \"Mahoney\"}","commentTags":["image"],"questionCommentData":null}],"ev-603":[{"id":"commentId-17","displayCommentEvent":{"id":"ev-603","timestamp":1661638274415,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":603,"type":"INSERT","fileId":"fileId-0","character":")","previousNeighborId":"ev-602","lineNumber":17,"column":27,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1661799601316,"commentText":"<div>You might be wondering what happens if you try and retrieve a value from a map where the specified key does not exist.</div><div><br></div><div>On line 17 I try and retrieve the value associated with the key, <span style=\"font-family: Courier;\">:suffix</span>, which does not exist in the map <span style=\"font-family: Courier;\">full_name</span>.</div><div><br></div><div>Elixir will return <span style=\"font-family: Courier;\">nil</span> which means the absence of a value. <span style=\"font-family: Courier;\">nil</span>'s don't produce any visible output when printed. <br></div>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"full_name[:suffix]","startRow":16,"startColumn":8,"endRow":16,"endColumn":26}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/08.exs","viewableBlogText":"IO.puts(full_name[:suffix])","commentTags":[],"questionCommentData":null}]};
